import React from "react";

const Home: React.FC = () => {
  return <h1>Home</h1>;
};

const Standings: React.FC = () => {
  return <h1>Standings</h1>;
};

const Teams: React.FC = () => {
  return <h1>Teams</h1>;
};

const Routes = [
  {
    path: "/",
    sidebarName: "Home",
    component: Home,
  },
  {
    path: "/standings",
    sidebarName: "Standings",
    component: Standings,
  },
  {
    path: "/teams",
    sidebarName: "Teams",
    component: Teams,
  },
];

export default Routes;
